import React from 'react';
import { Row, Col, Menu, Button } from 'antd';
import { MenuOutlined } from '@ant-design/icons';
import Logo from './Logo';


const AppLayout = ({ children }) => {
    const onClickMenu = () => {

    }

    const onClickLogo = () => {

    }

    return (
        <>
            <Row gutter={[8, 8]}>
                <Col md={5}>
                    <MenuOutlined onClick={onClickMenu} />

                </Col>

                <Col md={[8, 14]} >
                    <img onClick={onClickLogo} src="/logo.png" alt="EASYHO Blog"/>
                </Col>

                <Col md={5}>
                    <Button>회원가입</Button>
                </Col>
            </Row>

            <Row gutter={[8, 8]}>
                <Col md={6}>
        
                </Col>

                <Col md={12}>
                    {children}
                </Col>

                <Col md={2}>

                </Col>
            </Row>
        </>
    )
}

export default AppLayout;
